import './App.css';


function App() {
  const card = {
    name:"Ahmed",
    age:38,
    address:"Egypt"
  }
  return (
    <div id='Main'>
      <div>
      <div>{card.name}</div>
      <div>{card.age}</div>
      <div>{card.address}</div>
      </div>
    </div>
  );
}

export default App;
